import React from "react";
import client from "../contentful";
import "./home.css";

const Menu = () => {
  const [posts, setPosts] = React.useState(null);

  React.useEffect(() => {
    client
      .getEntries({
        content_type: "food",
      })
      .then((entries) => {
        setPosts(entries.items);
      });
  }, []);

  return (
    posts &&
    posts.map((post, i) => {
      return (
        <div>
          <h1> {post.fields.foodName} </h1>
          <h3> {post.fields.ingredients}</h3>
          <img className="foodImg" src={post.fields.image.fields.file.url} />
        </div>
      );
    })
  );
};

export default Menu;
